import React from 'react';

const MandalArtTable = ({value, onChange}) => {
    return (
        <div>
            <table>
                <tr>
                    <td><input value={this.props.aa} onChange={onChange}/></td>
                    <td><input value={this.props.ab} onChange={onChange}/></td>
                    <td><input value={this.props.ac} onChange={onChange}/></td>
                </tr>
                <tr>
                    <td><input value={this.props.ba} onChange={onChange}/></td>
                    <td><input value={this.props.bb} onChange={onChange}/></td>
                    <td><input value={this.props.bc} onChange={onChange}/></td>
                </tr>
                <tr>
                    <td><input value={this.props.ca} onChange={onChange}/></td>
                    <td><input value={this.props.cb} onChange={onChange}/></td>
                    <td><input value={this.props.cc} onChange={onChange}/></td>
                </tr>
            </table>
        </div>
    );
};

export default MandalArtTable;
